import React from "react";

class Select extends React.Component {
  render() {
    return (
      <label htmlFor="select">
        Escolha pelo Tipo:
        <select name="select">
          <option>Fire</option>
          <option>Psychic</option>
        </select>
      </label>
    );
  }
}

export default Select;
